  6,\n\t\"tags\": [],\n\t\"title\": \"Growth - Sustainable aquafeeds for marine finfish:
  Effects of vegetable oil replacement feeds containing novel microalgal and fungal
  oils on growth performance of juvenile sablefish\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-03-21T21:15:02.886161\",\n\t\"name\": \"growth-sustainable-aquafeeds-for-marine-finfish-effects-of-vegetable-oil-replacement-feeds-cont\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The concomitant replacement of fish meal
  and fish oil in carnivorous marine fish feeds by more sustainable terrestrial alternatives
  is problematic due to the limited capability of marine fish to synthesize physiological
  essential long chain n-3 and n-6 highly unsaturated fatty acids (HUFAs) from shorter
  chain fatty acid precursors present in some vegetable oils. This two-year study
  will employ sablefish (Anoplopoma fimbria) as a model marine finfish to systematically
  investigate the potential of fully replacing the added fish oil component of a typical
  low fishmeal feed suitable for marine aquaculture.nnThe focus of the proposed study
  will be on the effects of replacing fish oil in sablefish diets with sustainable
  lipid sources on diet utilization and growth. In particular, the overall goals of
  the proposed research are the following: nn1. Determine the ability of sablefish
  to synthesize essential HUFAs from shorter chain fatty acid precursors.nn2. Explore
  the effects of supplementing alternative vegetable oil feeds with novel sources
  of essential fatty acids on growth and nutrient utilization.nn3. Evaluate the feasibility
  of using these novel oils in practical feeds. Data obtained in these studies will
  further our understanding of sablefish nutrition and set the stage for future research
  on the effects of sustainable feed ingredients on product quality, fish health,
  and the reproductive potential of cultured broodstock programs. This research specifically
  addresses a priority of the 2008 National Marine Aquaculture Initiative, which is
  nutrition research involving alternative protein based diets and the influence of
  diet on product quality.nnFish weights and lengths.\",\n\t\"license_title\": null,\n\t\"extras\":
